('0af96836-aa9b-40bd-a108-7fe83c7ac08e', 'Mobbing (Yıldırma) Nedir?\r\n', 'mobbing-yildirma-nedir', 'İş yerlerinde son derece yaygın olan bu sorunu ortadan kaldırabilmek için yasal kuruluşların, sendikaların ve bireylerin birlikte ürettikleri çözümlere ihtiyaç vardır. Burada yıldırma ile karşılaşıldığında yalnızca bireysel olarak yapılabilecek bazı önerilere yer verilecektir. Bu öneriler üç evreye ayrılabilir:\r\n\r\nBunlardan ilki yıldırma davranışlarının henüz tam olarak ortaya çıkmadığı; fakat bazı işaretlerinin belirdiği evredir. Burada üstü kapalı bir şekilde de yapılabilecek yıldırma davranışının göstergelerini iyi bir şekilde tanımlayabilmek ve iş yerinin kurumsal olarak neler yapabileceğini tespit etmek, nasıl bir yol izleneceğine karar verebilmek için önemlidir. Ayrıca henüz küçük müdahaleler, ‘şakalaşmalar’ şeklinde kendini gösteren yıldırma davranışına karşı çekingen veya saldırgan bir şekilde davranmadan sınırları net bir şekilde çizmek, bu davranışın büyümesini engelleyebilir.\r\nYıldırma davranışının görünür bir hal alması ve yerleşmeye başlamasını da ikinci evre olarak ele almak mümkündür. Bu evrede saldırgan davranışlarla karşılaşılan e-posta, mesaj gibi kanıtları veya o sırada çevremizde olan kişilerin tanıklıklarını yazılı olarak saklamak hem olayları gözden geçirip emin olmaya hem de saldırgana karşı kanıt oluşturmaya yardım edebilir. Bunları yaparken izole olmaktansa çevreyle iyi ilişkiler kurmak, yasal haklarının ve kişisel ihtiyaçlarının farkında olmak kişinin kendisine güvenini ve iş performansını sürdürmesine yardımcı olabilir.\r\nYıldırma davranışlarının ve iş ortamının katlanılmaz hale gelmesi ise son evredir. Yaşanılan deneyimler çok zorlayıcı da olsa kendi hayatıyla ilgili kontrole sahip olduğunu düşünmek ve sorunu çözmek için hala yapabileceği şeyler olduğunu bilmek kişiye güven sağlayabilir. Psikolojik yardım için bir uzmana başvurmak, yaşanılan durumu ve çözüm önerilerini analiz edebilmeye yardım edebilir. Bunun sonucunda daha sağlıklı bir karar alınabilir. Süreç içerisinde önce işten izin almak, sonrasında ise sorunların devam edeceği öngörüldüğü takdirde ve yeni bir iş bulduktan sonra işten ayrılmak bir çözüm olabilir. Bunun yanı sıra yasal süreçlere başvurmak da tercih edilebilir. Son olarak tüm bu süreç boyunca yaşanılan duygusal ve belki maddi kayıplarla ilgili hisleri geçiştirmeden yaşamak ve buna yeterli zamanı ayırmak, sürecin daha sağlıklı bir şekilde atlatılabilmesine ve ileride taze bir başlangıç yapılabilmesine imkan tanıyabilir.', 'fd485cd8-73c5-4666-abab-272dde4727f4', 'ffc4511d-9345-4a87-b119-7445cb425fde', '2021-12-04 11:44:07'),
('1ced61f2-21f2-4873-9f04-a832955ed194', 'Kaş Merkezi', 'kas-merkezi', '<h1>Kaş Merkezi</h1>\r\n\r\n<p>Antik kent Antiphellos&#39;un &uuml;zerine kurulu olan Kaş merkezi, 1800&#39;l&uuml; yılların sonuna doğru Meis&#39;te yaşayan bazı Rum ailelerin kurdukları evler ile bir yerleşim merkezi haline gelmiş. 80&#39;li yıllara kadar k&uuml;&ccedil;&uuml;k bir balık&ccedil;ı kasabası g&ouml;r&uuml;n&uuml;m&uuml;ndeymiş. &Ouml;nce yabancı sonra yerli turistin keşfetmesi ile birlikte alternatif bir tatil kasabası olmuş. Alternatif kalmasının en b&uuml;y&uuml;k sebebi araba yoluyla gelmenin &ccedil;ok zor olmasıymış.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kaş g&uuml;n&uuml;m&uuml;zde, restoran ve konaklama yerlerinin dışında bir&ccedil;ok banka şubesi, marketler zinciri, her t&uuml;rl&uuml; d&uuml;kkan barındıran k&uuml;&ccedil;&uuml;k bir şehir havasında. Aslında y&uuml;r&uuml;yerek 1-2 saatte rahatlıkla dolaşabileceğiniz k&uuml;&ccedil;&uuml;kl&uuml;kte. T&uuml;m mekanların i&ccedil; i&ccedil;e olması canlı ve hareketli bir hava katıyor Kaş&#39;a.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kaş merkezinin kalbi tabiki meydanı. Olduk&ccedil;a geniş olan meydanın etrafı eski Rum evleriyle &ccedil;evrili. Bu evlerin hemen hemen hepsi şimdi kafe, restoran, d&uuml;kkan olarak hizmet veriyor. Kaş genel olarak dik bir yapıda olduğu i&ccedil;in bazılarının teraslarından manzara &ccedil;ok g&uuml;zel oluyor.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Meydanın hemen &ouml;n&uuml; teknelerin demirlediği&nbsp;<strong>Kaş Limanı</strong>. Liman, b&uuml;y&uuml;k bir mendirekle &ccedil;evrili. Kaş&#39;ta tekne turları ve dalış &ccedil;ok pop&uuml;ler, limanı sadece bu tekneler dolduruyor. &Ouml;zel teknesi ile gelenler marinaya demir atıyor.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Limanın sağ tarafı antik tiyatroya, sol tarafı K&uuml;&ccedil;&uuml;k &Ccedil;akıl denilen beach b&ouml;lgesine &ccedil;ıkıyor. İki tarafta da denize girebileceğiniz, ahşap platformlar &uuml;zerine kurulu, &ccedil;ok sayıda &#39;beach&#39; bulunuyor. Kaş kıyıları kayalık olduğu i&ccedil;in denize ancak bu şekilde girilebiliyor.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Uzun &Ccedil;arşı,</strong>&nbsp;100 yaşından eski Rum evlerinin bitişik nizam sıralandığı, taş d&ouml;şeli, trafiğe kapalı k&uuml;&ccedil;&uuml;k bir sokak. G&uuml;n&uuml;m&uuml;zde &ccedil;ok &ccedil;eşitli d&uuml;kkanlara ev sahipliği yapıyor. Orjinal ve se&ccedil;me &uuml;r&uuml;nlerin satıldığı d&uuml;kkanların sahiplerinin &ccedil;oğu, uzun yıllar &ouml;nce Kaş&#39;a g&ouml;&ccedil; etmiş şehirliler. Uzun &Ccedil;arşı&#39;nın etrafındaki dar sokaklar kafe ve barlarla dolu. Yazın sokağa sığamayan bir kalabalık oluyor burada. Canlı m&uuml;zik &ccedil;alan barlar ya da eski evlerin avlularına a&ccedil;ılmış kafeler keşfedilmeyi bekliyor. Sokağın sonunda Kral Mezarı denen, merkezdeki en b&uuml;y&uuml;k lahit (mezar) t&uuml;m heybetiyle karşılıyor sizi.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Kaş Marina</strong>, merkezden 15 dakikada y&uuml;r&uuml;yerek ulaşabileceğiniz bir noktada. Kaş,&nbsp; kıyılarının girintili &ccedil;ıkıntılı yapısından dolayı yat turizmi i&ccedil;in &ccedil;ok uygun. Merkezdeki mekanların i&ccedil; i&ccedil;eliğinden sonra marina &ccedil;ok ferah geliyor insana. Yazın kalabalıktan bunalan kendini buraya atabilir. Marinadaki 2 restoran ve 1 pub g&uuml;n boyunca hizmet veriyor. &Uuml;stelik pub&#39;ta bazı akşamlar canlı m&uuml;zik de oluyor.</p>\r\n\r\n<p>&nbsp;</p>', '126e6025-6abf-4e4a-851a-d0a372f2f0cc', '4bc4bd36-ac62-4d30-956a-6cc0c38bf642', '2021-12-04 12:00:44'),
('20636bb0-b5b1-422e-9386-0512eaaefa89', 'Kalkan Plajları', 'kalkan-plajlari', '<h3><strong>Kaputaş Plajı</strong></h3>\r\n\r\n<p>D&uuml;nyanın en g&uuml;zel plajlarından biri olan&nbsp;<strong>Kaputaş Plajı</strong>, Kalkan&rsquo;a sadece 7 km mesafede. Akdeniz sahili boyunca yer alan plajlar arasında kristal berraklıktaki deniz suyu ve eşsiz manzarasıyla &ouml;ne &ccedil;ıkan Kaputaş&rsquo;a uzun ve dik bir merdivenle iniliyor. İki y&uuml;ze yakın basamağın sonunda beyaz k&ouml;p&uuml;kl&uuml; dalgaların karşıladığı plajda deniz ince taneli kumlar arasında turkuaz rengiyle parlıyor.</p>\r\n\r\n<p>Koy &ccedil;ok b&uuml;y&uuml;k sayılmaz. Denizi dalgalı ve temiz. Temizliği ve olanakları ile mavi bayrağa sahip olan plajın sahili kumla k&uuml;&ccedil;&uuml;k &ccedil;akıl karışımı. Kumsalının altın sarısı olduğu plaja giriş &uuml;cretsiz. Tuvalet ve soyunma kabinleri i&ccedil;in de &uuml;cret &ouml;denmiyor. İki şezlong ve bir şemsiye 30 TL. İsterseniz havlunuzu bir kenara serip Kaputaş&rsquo;ın keyfini &ccedil;ıkarabilirsiniz.</p>\r\n\r\n<p>Kaputaş Plajı&rsquo;nın yakınlarında yer alan ve g&ouml;rmenizi tavsiye ettiğim bir g&uuml;zellik ise Mavi Mağara. Mağara 1972&rsquo;de keşfedilmiş, Kaş&rsquo;a 18 km mesafede. Uzunluğu 50 metre, genişliği 40 metre, y&uuml;ksekliği ise 15 metre. Girişinin dar oluşu nedeniyle deniz dibinden yansıyan g&uuml;neş ışıklarının muazzam ışık oyunları oluşturduğu mağaraya Kaş&rsquo;tan ve Kalkan&rsquo;dan hareket eden teknelerle ulaşılabiliyor.</p>', '126e6025-6abf-4e4a-851a-d0a372f2f0cc', 'ffc4511d-9345-4a87-b119-7445cb425fde', NULL),
('36583a82-56e5-4ad1-a59e-b3de4028d974', 'Narsist Partnerle İlişki', 'narsist-partnerle-iliski', '<p>Partneriniz aşırı derecede kendini beğenmiş; sizin duygularınıza ve d&uuml;ş&uuml;ncelerinize &ouml;nem vermeyen, s&uuml;rekli &ouml;vg&uuml; ve hayranlık bekleyen; kendini sizden, diğer insanlardan &uuml;st&uuml;n ve daima haklı g&ouml;ren biriyse narsisistik biri olma ihtimali y&uuml;ksektir. Narsisistik bir partnerle ilişki y&uuml;r&uuml;tmek yorucu ve zorlayıcı olabilir. Size kendinizi bir&ccedil;ok a&ccedil;ıdan yetersiz hissettirebilirler. Bu nedenle ilişkinizde sağlıklı sınırlar oluşturmanız &ccedil;ok &ouml;nemlidir. Sağlıklı sınırları olan bir ilişkide sizin de ihtiya&ccedil;larınız vardır, duygu ve d&uuml;ş&uuml;nceleriniz &ouml;nemli ve değerlidir. İhtiya&ccedil;larınıza, duygu ve d&uuml;ş&uuml;ncelerinize sahip &ccedil;ıkmalısınız. Narsisistik partner ihtiya&ccedil;larınızı &ouml;nemsemeyip g&ouml;rmezden gelerek, duygu ve d&uuml;ş&uuml;ncelerinize kulak asmayarak sınırlarınızı ihlal etmeye &ccedil;alışabilir. Ancak bunun sizin sınırınıza haksız bir m&uuml;dahale olduğunu fark etmeniz ve m&uuml;saade etmemeniz &ouml;nemlidir. Hi&ccedil; kimse sizin ihtiya&ccedil;larınızı sizden daha iyi bilemez, bu m&uuml;mk&uuml;n değildir. Partneriniz hatta hi&ccedil; kimse size ne d&uuml;ş&uuml;nmeniz ya da ne hissetmeniz gerektiğini s&ouml;yleme hakkına sahip değildir. D&uuml;ş&uuml;nceleriniz ve hisleriniz size aittir, siz isterseniz değişirler. Sınırlarınızın ihlal edildiği anları fark edin ve sağlıklı sınırlar oluşturma &uuml;zerine ger&ccedil;ek&ccedil;i bir plan yapın. Partneriniz narsisistik bir birey olsun ya da olmasın sağlıklı sınırlar her ilişki i&ccedil;in gereklidir. Ancak &ouml;zellikle de narsisistik bir partnerleyken olmazsa olmazdır. Siz sağlıklı sınırlar belirlediğinizde ve bunları uygulamaya başladığınızda partneriniz şaşırabilir, bu yeni sınırlara &ouml;fkelenebilir ve sınırlarınızı zorlamaya başlayabilir. Partneriniz &ouml;zel muamele g&ouml;rmesi gerektiğine inandığı ve sizden de bunu beklediği i&ccedil;in sınırlarınızı tanımayabilir. Sınırlarınıza saldırmayı kendine hak g&ouml;rebilir. Bu noktada sınırlarınızın ve kararlarınızın arkasında durmanız &ccedil;ok &ouml;nemlidir. Kimsenin siz izin vermediğiniz m&uuml;ddet&ccedil;e sizin koyduğunuz sınırları aşmak gibi bir hakkı yoktur. Sınırlar sizin bah&ccedil;enizin &ccedil;itleridir, alanınızın nerede başlayıp nerede bittiğini belirtirler. Bah&ccedil;enizi dış d&uuml;nyadan gelebilecek tehlikelerden korurlar, oranın sahipsiz olmadığını g&ouml;sterirler. Bu nedenle sınır koymak &ouml;nemlidir. Sınırlarınızın arkasında kararlılıkla durun &ccedil;&uuml;nk&uuml; gevşettiğiniz anda tekrar sınır koymak &ccedil;ok daha zor olabilir. Narsisistik bir partnerle beraber olan bazı kişiler partnerlerini &ldquo;değiştirme&rdquo;, &ldquo;d&uuml;zeltme&rdquo; gibi ger&ccedil;ek dışı ama&ccedil;lar edinebilirler. Bu ama&ccedil;ları ger&ccedil;ekleşmedik&ccedil;e de hayal kırıklığına kapılıp hayıflanabilirler. Unutmayın ki siz kimsenin kurtarıcısı değilsiniz. Ayrıca kişi kendi davranışlarını fark edip bunlardan rahatsız olmadığı ya da bunları değiştirmek istemediği s&uuml;rece değişemez. Partnerinizin sizi ya da diğer insanları rahatsız eden davranışları konusunda farkındalık kazanmasını sağlayacak adımlar atabilirsiniz ya da onu bir uzmanla g&ouml;r&uuml;şmesi i&ccedil;in destekleyebilirsiniz. Ancak en nihayetinde bunu yapacak olan kendisidir. Kendinizi bir kurtarıcı rol&uuml;ne sokmak ya da &uuml;zerinize fazlaca sorumluluk almak yalnızca sizi yıpratır. Narsisistik bir partner sizi duygusal a&ccedil;ıdan zorlayabilir. Partneriniz karşısında yargılanmış ve t&uuml;kenmiş hissedebilirsiniz. Bu ilişki fiziksel ve psikolojik sağlığınıza zarar verebilir. Bu noktada siz de bir uzmana danışabilirsiniz. Sosyal destek sisteminizi (aile, arkadaş vb.) devreye sokabilir; yaşadıklarınızı, duygu ve d&uuml;ş&uuml;ncelerinizi onlarla paylaşabilirsiniz. Size iyi gelen aktivitelere daha &ccedil;ok zaman ayırabilirsiniz. Narsisistik bir partnerle beraberken sizin de zorlanmanız normaldir. Destek istemekten &ccedil;ekinmeyin, yalnız olmak zorunda değilsiniz.</p>', 'fd485cd8-73c5-4666-abab-272dde4727f4', '4bc4bd36-ac62-4d30-956a-6cc0c38bf642', NULL),
('4a420194-e27e-4231-a841-35571f84820d', 'Patara Antik Kenti ve Plajı', 'patara-antik-kenti-ve-plaji', '<p><strong>Patara Antik Kenti</strong>, Kaş&rsquo;a yakın &ccedil;ok &ouml;zel bir antik kent. Fethiye-Kalkan arasında Xanthos vadisinin g&uuml;neybatı ucunda bug&uuml;nk&uuml; Ovagelemiş k&ouml;y&uuml;nde yer alıyor. Kalkan&rsquo;dan Patara&rsquo;ya gidiş yaklaşık 20 dakika s&uuml;r&uuml;yor. T&uuml;rkiye&rsquo;nin en uzun plajı ve &lsquo;Tarihteki en iyi demokrasi &ouml;rneği&rsquo; olarak g&ouml;sterilen Likya Birliğinin &uuml;nl&uuml; meclisi burada. D&uuml;nyada&nbsp;<a href=\"https://yoldaolmak.com/noel-baba-kimdir.html\">Noel Baba</a>&nbsp;olarak bilinen Aziz Nikolaos&rsquo;ın doğduğu yer olarak da biliniyor. Patara Antik Kenti UNESCO Listesine girmeyi hak ediyor.</p>\r\n\r\n<p>Ayakta kalan en eski demokratik meclis binası, Helenistik form ile Roma mimarisi arasında ge&ccedil;işi temsil eden Patara amfitiyatrosu, Roma İmparatoru Neron&rsquo;un prestij eseri olarak yaptırılan, d&uuml;nyanın en eski deniz feneri kalıntıları, bazilika, kiliseler, Patara takı ve hamamlar ayakta kalan yapılar. Patara Plajı ise antik kentin denizle buluştuğu yerde kilometrelerce uzanıyor.</p>\r\n\r\n<p><strong>Patara Plajı</strong>, caretta carettaların milyonlarca yıldır yumurtalarını bıraktığı ender sahillerden. Plajın hemen arkasında kum tepeleri var ve &ccedil;&ouml;l havasında. Yeşil&ccedil;am filmlerindeki &ccedil;&ouml;l sahnelerinde burada &ccedil;ekilmiş. &Ouml;nce Xsanthos, Letoon ve Patara antik kentleri gezisi yapıp sonra da Patara Plajında g&uuml;n&uuml;n keyfini s&uuml;rd&uuml;rebileceğiniz, sevdiğim bir yer. Akşam 18.00 sonrası ziyaret yasağı var.</p>\r\n\r\n<p>Patara Antik Kenti yaz d&ouml;nemi (1 Nisan &ndash; 1 Ekim) 08.00-19.00, Kış d&ouml;nemi (1 Ekim &ndash; 1 Nisan) 08.30-17.30 arası ziyaret edilebilir. &Ouml;ren yeri haftanın 7 g&uuml;n&uuml; ziyarete a&ccedil;ık. Bilet satışı kapanıştan yarım saat &ouml;nce sona eriyor. Patara Antik Kenti giriş &uuml;creti 30TL. M&uuml;ze Kart ge&ccedil;erli.</p>\r\n\r\n<p><strong>Xanthos Antik Kenti</strong>, Likya Birliğine başkentlik yapmış b&uuml;y&uuml;leyici bir antik kent. Kalkan&rsquo;dan antik kente gitmek sadece yarım saat s&uuml;r&uuml;yor. Tarihte Likya Birliğinin idari merkezi olan antik kent T&uuml;rkiye&rsquo;nin UNESCO Listesine giren en eski tarihi değerlerinden.</p>\r\n\r\n<p>Xantos ge&ccedil;mişte gemilerin yanaşabileceği bir kıyı kentiymiş. Zaman i&ccedil;inde nehrin getirdiği al&uuml;vyonların denizi doldurmasıyla bug&uuml;n kıyıdan 8 km i&ccedil;eride kalmış. &Ouml;zg&uuml;rl&uuml;k uğruna savaşan t&uuml;m halkının tarih sahnesinden silindiği acıklı bir hik&acirc;yesi de var.</p>\r\n\r\n<p>M&Ouml; 545&rsquo;te Anadolu&rsquo;yu silip s&uuml;p&uuml;ren g&uuml;&ccedil;l&uuml; Pers ordusunun saldırısına karşı Xanthoslular efsanevi bir savunma g&ouml;sterse de direnişin fayda getirmeyeceğini anlamışlar. Bir tane bile Xanthoslunun teslim olmaması i&ccedil;in kadınlarını, &ccedil;ocuklarını, k&ouml;lelerini ve t&uuml;m mal varlıklarını toplayarak kalenin i&ccedil;inde ateşe vermişler ve &ouml;l&uuml;nceye kadar savaşmışlar.</p>\r\n\r\n<p>M&Ouml; 7. y&uuml;zyıla uzanan tarihi ge&ccedil;mişi sahip Xanthos&rsquo;ta, lahitler, mezarlar ve bir de antik tiyatro bulunuyor. Antik d&ouml;nemin en demokrat birliğinin başkentindeki t&uuml;m r&ouml;lyefler ve b&uuml;y&uuml;k mimari par&ccedil;alar bug&uuml;n Londra&rsquo;daki&nbsp;<a href=\"https://yoldaolmak.com/british-museum-londra.html\">British Museum</a>&rsquo;da sergileniyor.</p>\r\n\r\n<p>Xsanthos Antik Kenti yaz d&ouml;nemi (1 Nisan &ndash; 1 Ekim) 08.00-19.00, Kış d&ouml;nemi (1 Ekim &ndash; 1 Nisan) 08.30-17.30 arası ziyaret edilebilir. &Ouml;ren yeri haftanın 7 g&uuml;n&uuml; ziyarete a&ccedil;ık. Ksanthos Antik Kenti giriş &uuml;creti 14TL. M&uuml;ze Kart ge&ccedil;erli.</p>\r\n\r\n<h3><strong>7. Letoon Antik Kenti</strong></h3>\r\n\r\n<p><strong>Letoon Antik Kenti</strong>&nbsp;ise Kalkan&rsquo;ın bir diğer m&uuml;cevheri. UNESCO listesinde yer alan antik kent M&Ouml; 8. y&uuml;zyıla ait. Likya Birliğinin dini merkezi olan yerleşim Fethiye&rsquo;ye bağlı Kumluova k&ouml;y&uuml;n&uuml;n yakınlarında yer alıyor. Likya&rsquo;nın bu kutsal alanı Kalkan&rsquo;a yarım saat uzaklıkta. Xanthos ile arası ise sadece 10 dakika. Yunan mitolojisinde Zeus&rsquo;un &ccedil;ocukları olan Artemis ve Apollo&rsquo;nun annesi Leto&rsquo;dan adını alıyor.</p>\r\n\r\n<p>Antik kent merkezinde, yan yana dizilmiş &uuml;&ccedil; tapınak bulunuyor. Bunlardan en batıda İon d&uuml;zenindeki tapınak kentin tanrı&ccedil;ası olan Leto&rsquo;ya, daha k&uuml;&ccedil;&uuml;k olan ve ortada yer alan tapınak Artemis&rsquo;e, en doğudaki Dor d&uuml;zenli ise Apollon&rsquo;a ait. &Ouml;ren yeri i&ccedil;erisindeki stoalı &ccedil;eşme yapısı ve Helenistik devir tiyatrosu da kentin tarihi zenginliklerinden.</p>\r\n\r\n<p>Letoon Antik Kenti yaz d&ouml;nemi (1 Nisan &ndash; 1 Ekim) 08.00-19.00, Kış d&ouml;nemi (1 Ekim &ndash; 1 Nisan) 08.30-17.30 arası ziyaret edilebilir. &Ouml;ren yeri haftanın 7 g&uuml;n&uuml; ziyarete a&ccedil;ık. Bilet satışı kapanıştan yarım saat &ouml;nce sona eriyor. Letoon Antik Kenti giriş &uuml;creti 12TL. M&uuml;ze Kart ge&ccedil;erli.</p>\r\n\r\n<h3><strong>8. Bezirg&acirc;n K&ouml;y&uuml;</strong></h3>\r\n\r\n<p><strong>Bezirg&acirc;n K&ouml;y&uuml;</strong>, İngiliz The Times Gazetesi tarafından T&uuml;rkiye&rsquo;de gidilmesi gereken gizli kalmış 6 yerden biri olarak g&ouml;sterilmiş. K&ouml;y, T&uuml;rkmen ve Y&ouml;r&uuml;k k&uuml;lt&uuml;r&uuml;n&uuml;n izlerini taşıyor. Deniz seviyesinden 700 metre y&uuml;kseklikteki Bezirg&acirc;n yaylasında yer alan k&ouml;y 300 yıllık tarihi ge&ccedil;mişe sahip. Kalkan&rsquo;da yaşayan bir&ccedil;ok ailenin burada yayla evi var.</p>\r\n\r\n<p>K&ouml;y&uuml;n yerel mimariye sahip taş evleri &ccedil;ok g&uuml;zel. K&ouml;yde yaşayanların &uuml;rettiği &uuml;r&uuml;nlerin satıldığı şirin bir pazar yeri var. Doğal &uuml;r&uuml;nler arayanlar bu pazarı &ccedil;ok seviyor. Bezirg&acirc;n k&ouml;y&uuml; ve Bezirg&acirc;n yaylası, Kalkan&rsquo;a ise 12 km mesafede yer alıyor.</p>\r\n\r\n<p>Doğa y&uuml;r&uuml;y&uuml;ş&uuml; yapabileceğiniz yaylada konaklama se&ccedil;eneği fazla değil. K&ouml;yde 2 bin yıldan fazla bir s&uuml;re &ouml;nce Likyalılar tarafından kullanılan ahşap tahıl ambarlarını halen ayakta. Ambarların işlevi ve tasarımının o zamandan bu yana &ccedil;ok az değiştiği s&ouml;yleniyor.</p>', '126e6025-6abf-4e4a-851a-d0a372f2f0cc', 'ee133e8b-3590-4434-a891-4529896f8734', '2021-12-04 11:47:02'),
('5208e707-ba15-4a6f-8a8f-fc35766847f1', 'Kalkan Gezilecek Yerler', 'kalkan-gezilecek-yerler', '<p><strong>Kalkan</strong>, Antalya&rsquo;nın batısında kalan&nbsp;<a href=\"https://www.boattripturkey.com/tr/kas-gezi-rehberi/\">Kaş</a>&nbsp;il&ccedil;esinin en g&uuml;zel beldesi. Kaş&rsquo;dan Fethiye y&ouml;n&uuml;ne doğru sahilden devam edince ana yolun hemen altında sahil kenarında kalıyor. &Ccedil;ekici bir turizm beldesi olan Kalkan, Eski Rum evleri, k&uuml;&ccedil;&uuml;k yat limanı, Likya kaya mezarları, tertemiz havası ve ışıldayan masmavi deniziyle &uuml;lkemizde doğallığını koruyan az sayıdaki yerden biri.</p>\r\n\r\n<p>Antalya ile Fethiye arasında Akdeniz sahil şeridinde yer alan Kalkan, mavi tur yolculukla keşfe &ccedil;ıkanların da g&ouml;zde duraklarından. Yaz-kış beldede yaşayan entelekt&uuml;el, varlıklı n&uuml;fusuyla zengin bir k&uuml;lt&uuml;r sanat yaşamına sahip olan belde, yaz aylarında &ouml;zellikle Avrupalı ziyaret&ccedil;ilerin akınına uğruyor.</p>\r\n\r\n<p>Kaş&rsquo;ın yaklaşık 30 km batısında bulunan Kalkan, bir tabloyu andıran g&uuml;zelliğiyle k&uuml;&ccedil;&uuml;k bir liman kasabası. Yaz aylarında &ccedil;ok canlı olan Kalkan gezilecek yerleri ve aktivitelerinin yanı sıra tekne turları, barları, otelleri, pansiyonları ve balık restoranlarıyla &uuml;nl&uuml;.</p>\r\n\r\n<p>Kalkan, sahilden tepeye doğru teras şeklinde dizilmiş nefes kesici modern villaları, şık butik otelleri, beyaz mimarisi, farklı renklerdeki begonvillerle s&uuml;sl&uuml; sokaklarıyla Akdeniz ruhuna sahip.</p>\r\n\r\n<p>Kaş il&ccedil;esine bağlı olan Kalkan, Osmanlılar zamanında yakınındaki Meis Adası&rsquo;nda yaşayan t&uuml;ccarlar tarafından kurulmuş ve o d&ouml;nemin &ouml;nemli deniz ticaret limanı durumundaymış. Daha sonra Antalya karayolunun a&ccedil;ılmasıyla deniz ticareti &ouml;nemini kaybetmiş ve t&uuml;ccarlar burayı terk etmişler.</p>\r\n\r\n<p>Ağırlıklı İngilizlerin yaşadığı Kalkan, milattan &ouml;nce yaşamış Heredot&rsquo;un &ldquo;Yıldızlara en Yakın Yer&rdquo; dediği belde. El değmemiş doğal g&uuml;zellikleri ve &ccedil;evresindeki Likya medeniyetine ait tarihi kalıntıları ile T&uuml;rkiye&rsquo;nin ve d&uuml;nyanın sayılı turizm merkezlerinden biri.</p>\r\n\r\n<p>Kalkan konumu itibariyle &uuml;&ccedil; b&ouml;lgeye ayrılmış. Bunlardan ilki g&uuml;n&uuml;m&uuml;zde &ccedil;arşı olarak kullanılan ve dar sokaklı tarihi evlerin bulunduğu b&ouml;l&uuml;m. Diğer bir b&ouml;lge ise yeni yerleşim alanı olan ve villaların bulunduğu alan. Muhteşem manzarasından dolayı bu villalar yama&ccedil;lara doğru y&uuml;kseliyor. Son b&ouml;lge ise g&uuml;zel otellerin ve villaların bulunduğu b&ouml;lge.</p>\r\n\r\n<h2><strong>Kalkan Gezilecek Yerler</strong></h2>\r\n\r\n<p>Kalkan i&ccedil;in gezilecek yerler listesi dolu dolu. G&ouml;r&uuml;lecek koylar, plajlar, k&ouml;yler, antik kentler ve keşfedilecek pek &ccedil;ok yeri var. Gezmeye beyaz evleri, ve tertemiz sokaklarıyla insanı kendine hayran bırakan &ccedil;arşıyla başlayabilirsiniz. Hemen &ccedil;arşının &ouml;n&uuml;nde denize girebileceğiniz bir halk plajı var. En az yarım g&uuml;n&uuml;n&uuml;z&uuml; merkeze ayrın.</p>\r\n\r\n<p>Kalkan&rsquo;ın Likya&rsquo;nın başkenti ve kalbi olan Xsantos&rsquo;a, dini merkez Letoon&rsquo;a ve 35 y&uuml;zyıl &ouml;nce h&uuml;k&uuml;m s&uuml;rm&uuml;ş olan gizemli Likya uygarlığını denize bağlayan Patara limanına sadece birka&ccedil; kilometrelik mesafede. Merkezi gezdikten sonra, antik kentleri ve Patara&rsquo;yı g&ouml;r&uuml;n.</p>\r\n\r\n<p>Sahilden hareket eden tekne turlarını misafirlerimiz &ccedil;ok seviyor. Birbirinden g&uuml;zel koylar, b&uuml;kler ve muhteşem bir kıyı şeridi g&ouml;receksiniz. Karadan ulaşımın imkansız olduğu yerleri g&ouml;rmek, bakir koylarda y&uuml;zmek ger&ccedil;ekten &ccedil;ok keyifli ve unutulmaz bir deneyim. Kalkan&rsquo;ı denizden g&ouml;rmek bir başka g&uuml;zel.&nbsp;<a href=\"https://www.boattripturkey.com/tr/kalkan-tekne-turu/\">Kalkan tekne turları</a>&nbsp;aktivitelerinden birine mutlaka katılın.</p>\r\n\r\n<p>Kaş Kalkan b&ouml;lgesi plajları genellikle &ccedil;akıllı, ancak Kalkan konumu itibariyle muhteşem bir kumsalı olan Patara Plajı&rsquo;na da sahip. Kalkan ve Patara arası mesafe kısa olduğu i&ccedil;in g&uuml;n i&ccedil;inde rahatlıkla gidip gelebilirsiniz. Şehirden uzaklaşmak istemeyenler i&ccedil;in de şehir merkezinde bulunan plajlara veya k&uuml;&ccedil;&uuml;k &ccedil;akıl taşlarından oluşan Kalkan Plajı&rsquo;na gidebilirsiniz.</p>\r\n\r\n<p>Kalkan, yatların konaklayabileceği bir marinası, barları, balık lokantaları ile s&uuml;rekli artan ziyaret&ccedil;i potansiyeline sahip tatil beldelerinden biri. Eğlenceli gece hayatının yanında Kalkan, size muhteşem deniz manzarası eşliğinde yıldızların altında yemek yiyebileceğiniz restoranlar sunuyor.</p>\r\n\r\n<p>Limanın hemen etrafında toplanmış bir&ccedil;ok kaliteli restorandan birine oturup, gelen balık&ccedil;ı teknelerini ve g&uuml;neşin sessiz sedasız batışını izleyebilirsiniz. Kalkan, restoranları ile Ege ve Akdeniz&rsquo;e &ouml;zg&uuml; yemek &ccedil;eşitlerinin yanında d&uuml;nya mutfağının &ouml;rneklerini de sunuyorlar.</p>\r\n\r\n<p><strong>Kalkan</strong>&lsquo;ın merkezi sevimli k&uuml;&ccedil;&uuml;k ve &ccedil;ok sevimli. Sokaklar ve evler beyaza boyalı. Hafiften bir Yunan mimarisi havası var. K&uuml;&ccedil;&uuml;k bir k&ouml;rfez i&ccedil;inde yerleşmiş olan Kalkan&rsquo;ın her sokağı fotoğraflık. Bar ve kafeleri, liman &ccedil;evresinde sıralanan balık lokantaları, temiz pansiyon ve butik otelleri ve mis gibi deniz havasıyla g&uuml;r&uuml;lt&uuml;den ve koşturmadan uzak sakin bir atmosfere sahip.</p>\r\n\r\n<p>Sahilin hemen yanı başından yukarı doğru devam eden sokakların iki yanında iki katlı, beyaza boyalı evler sıralanıyor. T&uuml;m sokaklar denize a&ccedil;ılıyor. Ahşap panjurlu evler, avlular, begonvillerin s&uuml;slediği sokaklar i&ccedil; i&ccedil;e ge&ccedil;miş gibi.</p>\r\n\r\n<p>Teras halinde dizili evlerin sayısı her yıl daha da artıyor. 20 yıl &ouml;nce, yama&ccedil;taki evler yeşilliklerin arasında az sayıdaydı. Son yıllarda Kalkan&rsquo;ın n&uuml;fusu hızla arttı. Kalkan&rsquo;ın g&uuml;zelliğine kapılan ziyaret&ccedil;ilerimiz artık misafirimiz değil, komşularımız oldu. Şimdilerde uzaktan bakınca t&uuml;m tepe beyaza b&uuml;r&uuml;nm&uuml;ş gibi g&ouml;r&uuml;n&uuml;yor.</p>\r\n\r\n<p>Sokak boyunca sıralan evlerin giriş katlarındaki &ccedil;ok sayıda k&uuml;&ccedil;&uuml;k bar, restoran ve kafelerin hepsi de &ccedil;ok havalı. Evler, d&uuml;kkanlar en fazla iki katlı, dikey yapılaşma yok. Gelen giden &ccedil;ok olunca bir&ccedil;ok ev de butik otel ve pansiyon olarak hizmet vermeye başladı.</p>\r\n\r\n<p>&Ccedil;arşıda en g&ouml;ze &ccedil;arpan yapı Kalkan Camii. M&uuml;badeleden &ouml;nce Rum Ortodoks Kilisesi olan zarif yapı g&uuml;n&uuml;m&uuml;zde her yerden g&ouml;r&uuml;lebiliyor. 1897&rsquo;de yapılmış olan oymalı kilisenin &ccedil;anı ise şimdi Kalkan K&ouml;y Odasında. Cumhuriyet caddesinden 5 dakika y&uuml;r&uuml;y&uuml;ş mesafesinde g&ouml;z alıcı mavilikte Akdeniz ve Kalkan plajı uzanıyor.</p>', '126e6025-6abf-4e4a-851a-d0a372f2f0cc', '4bc4bd36-ac62-4d30-956a-6cc0c38bf642', '2021-12-04 11:50:48'),
('57358497-2b1f-4389-97ac-93dcc965bee6', 'Kalkan Gezilecek Yerler', 'kalkan-gezilecek-yerler', '<p><strong>Kalkan</strong>, Antalya&rsquo;nın batısında kalan&nbsp;<a href=\"https://www.boattripturkey.com/tr/kas-gezi-rehberi/\">Kaş</a>&nbsp;il&ccedil;esinin en g&uuml;zel beldesi. Kaş&rsquo;dan Fethiye y&ouml;n&uuml;ne doğru sahilden devam edince ana yolun hemen altında sahil kenarında kalıyor. &Ccedil;ekici bir turizm beldesi olan Kalkan, Eski Rum evleri, k&uuml;&ccedil;&uuml;k yat limanı, Likya kaya mezarları, tertemiz havası ve ışıldayan masmavi deniziyle &uuml;lkemizde doğallığını koruyan az sayıdaki yerden biri.</p>\r\n\r\n<p>Antalya ile Fethiye arasında Akdeniz sahil şeridinde yer alan Kalkan, mavi tur yolculukla keşfe &ccedil;ıkanların da g&ouml;zde duraklarından. Yaz-kış beldede yaşayan entelekt&uuml;el, varlıklı n&uuml;fusuyla zengin bir k&uuml;lt&uuml;r sanat yaşamına sahip olan belde, yaz aylarında &ouml;zellikle Avrupalı ziyaret&ccedil;ilerin akınına uğruyor.</p>\r\n\r\n<p>Kaş&rsquo;ın yaklaşık 30 km batısında bulunan Kalkan, bir tabloyu andıran g&uuml;zelliğiyle k&uuml;&ccedil;&uuml;k bir liman kasabası. Yaz aylarında &ccedil;ok canlı olan Kalkan gezilecek yerleri ve aktivitelerinin yanı sıra tekne turları, barları, otelleri, pansiyonları ve balık restoranlarıyla &uuml;nl&uuml;.</p>\r\n\r\n<p>Kalkan, sahilden tepeye doğru teras şeklinde dizilmiş nefes kesici modern villaları, şık butik otelleri, beyaz mimarisi, farklı renklerdeki begonvillerle s&uuml;sl&uuml; sokaklarıyla Akdeniz ruhuna sahip.</p>\r\n\r\n<p>Kaş il&ccedil;esine bağlı olan Kalkan, Osmanlılar zamanında yakınındaki Meis Adası&rsquo;nda yaşayan t&uuml;ccarlar tarafından kurulmuş ve o d&ouml;nemin &ouml;nemli deniz ticaret limanı durumundaymış. Daha sonra Antalya karayolunun a&ccedil;ılmasıyla deniz ticareti &ouml;nemini kaybetmiş ve t&uuml;ccarlar burayı terk etmişler.</p>\r\n\r\n<p>Ağırlıklı İngilizlerin yaşadığı Kalkan, milattan &ouml;nce yaşamış Heredot&rsquo;un &ldquo;Yıldızlara en Yakın Yer&rdquo; dediği belde. El değmemiş doğal g&uuml;zellikleri ve &ccedil;evresindeki Likya medeniyetine ait tarihi kalıntıları ile T&uuml;rkiye&rsquo;nin ve d&uuml;nyanın sayılı turizm merkezlerinden biri.</p>\r\n\r\n<p>Kalkan konumu itibariyle &uuml;&ccedil; b&ouml;lgeye ayrılmış. Bunlardan ilki g&uuml;n&uuml;m&uuml;zde &ccedil;arşı olarak kullanılan ve dar sokaklı tarihi evlerin bulunduğu b&ouml;l&uuml;m. Diğer bir b&ouml;lge ise yeni yerleşim alanı olan ve villaların bulunduğu alan. Muhteşem manzarasından dolayı bu villalar yama&ccedil;lara doğru y&uuml;kseliyor. Son b&ouml;lge ise g&uuml;zel otellerin ve villaların bulunduğu b&ouml;lge.</p>\r\n\r\n<h2><strong>Kalkan Gezilecek Yerler</strong></h2>\r\n\r\n<p>Kalkan i&ccedil;in gezilecek yerler listesi dolu dolu. G&ouml;r&uuml;lecek koylar, plajlar, k&ouml;yler, antik kentler ve keşfedilecek pek &ccedil;ok yeri var. Gezmeye beyaz evleri, ve tertemiz sokaklarıyla insanı kendine hayran bırakan &ccedil;arşıyla başlayabilirsiniz. Hemen &ccedil;arşının &ouml;n&uuml;nde denize girebileceğiniz bir halk plajı var. En az yarım g&uuml;n&uuml;n&uuml;z&uuml; merkeze ayrın.</p>\r\n\r\n<p>Kalkan&rsquo;ın Likya&rsquo;nın başkenti ve kalbi olan Xsantos&rsquo;a, dini merkez Letoon&rsquo;a ve 35 y&uuml;zyıl &ouml;nce h&uuml;k&uuml;m s&uuml;rm&uuml;ş olan gizemli Likya uygarlığını denize bağlayan Patara limanına sadece birka&ccedil; kilometrelik mesafede. Merkezi gezdikten sonra, antik kentleri ve Patara&rsquo;yı g&ouml;r&uuml;n.</p>\r\n\r\n<p>Sahilden hareket eden tekne turlarını misafirlerimiz &ccedil;ok seviyor. Birbirinden g&uuml;zel koylar, b&uuml;kler ve muhteşem bir kıyı şeridi g&ouml;receksiniz. Karadan ulaşımın imkansız olduğu yerleri g&ouml;rmek, bakir koylarda y&uuml;zmek ger&ccedil;ekten &ccedil;ok keyifli ve unutulmaz bir deneyim. Kalkan&rsquo;ı denizden g&ouml;rmek bir başka g&uuml;zel.&nbsp;<a href=\"https://www.boattripturkey.com/tr/kalkan-tekne-turu/\">Kalkan tekne turları</a>&nbsp;aktivitelerinden birine mutlaka katılın.</p>\r\n\r\n<p>Kaş Kalkan b&ouml;lgesi plajları genellikle &ccedil;akıllı, ancak Kalkan konumu itibariyle muhteşem bir kumsalı olan Patara Plajı&rsquo;na da sahip. Kalkan ve Patara arası mesafe kısa olduğu i&ccedil;in g&uuml;n i&ccedil;inde rahatlıkla gidip gelebilirsiniz. Şehirden uzaklaşmak istemeyenler i&ccedil;in de şehir merkezinde bulunan plajlara veya k&uuml;&ccedil;&uuml;k &ccedil;akıl taşlarından oluşan Kalkan Plajı&rsquo;na gidebilirsiniz.</p>\r\n\r\n<p>Kalkan, yatların konaklayabileceği bir marinası, barları, balık lokantaları ile s&uuml;rekli artan ziyaret&ccedil;i potansiyeline sahip tatil beldelerinden biri. Eğlenceli gece hayatının yanında Kalkan, size muhteşem deniz manzarası eşliğinde yıldızların altında yemek yiyebileceğiniz restoranlar sunuyor.</p>\r\n\r\n<p>Limanın hemen etrafında toplanmış bir&ccedil;ok kaliteli restorandan birine oturup, gelen balık&ccedil;ı teknelerini ve g&uuml;neşin sessiz sedasız batışını izleyebilirsiniz. Kalkan, restoranları ile Ege ve Akdeniz&rsquo;e &ouml;zg&uuml; yemek &ccedil;eşitlerinin yanında d&uuml;nya mutfağının &ouml;rneklerini de sunuyorlar.</p>\r\n\r\n<h3><strong>1. Kalkan Merkez</strong></h3>\r\n\r\n<p><strong>Kalkan</strong>&lsquo;ın merkezi sevimli k&uuml;&ccedil;&uuml;k ve &ccedil;ok sevimli. Sokaklar ve evler beyaza boyalı. Hafiften bir Yunan mimarisi havası var. K&uuml;&ccedil;&uuml;k bir k&ouml;rfez i&ccedil;inde yerleşmiş olan Kalkan&rsquo;ın her sokağı fotoğraflık. Bar ve kafeleri, liman &ccedil;evresinde sıralanan balık lokantaları, temiz pansiyon ve butik otelleri ve mis gibi deniz havasıyla g&uuml;r&uuml;lt&uuml;den ve koşturmadan uzak sakin bir atmosfere sahip.</p>\r\n\r\n<p>Sahilin hemen yanı başından yukarı doğru devam eden sokakların iki yanında iki katlı, beyaza boyalı evler sıralanıyor. T&uuml;m sokaklar denize a&ccedil;ılıyor. Ahşap panjurlu evler, avlular, begonvillerin s&uuml;slediği sokaklar i&ccedil; i&ccedil;e ge&ccedil;miş gibi.</p>\r\n\r\n<p>Teras halinde dizili evlerin sayısı her yıl daha da artıyor. 20 yıl &ouml;nce, yama&ccedil;taki evler yeşilliklerin arasında az sayıdaydı. Son yıllarda Kalkan&rsquo;ın n&uuml;fusu hızla arttı. Kalkan&rsquo;ın g&uuml;zelliğine kapılan ziyaret&ccedil;ilerimiz artık misafirimiz değil, komşularımız oldu. Şimdilerde uzaktan bakınca t&uuml;m tepe beyaza b&uuml;r&uuml;nm&uuml;ş gibi g&ouml;r&uuml;n&uuml;yor.</p>\r\n\r\n<p>Sokak boyunca sıralan evlerin giriş katlarındaki &ccedil;ok sayıda k&uuml;&ccedil;&uuml;k bar, restoran ve kafelerin hepsi de &ccedil;ok havalı. Evler, d&uuml;kkanlar en fazla iki katlı, dikey yapılaşma yok. Gelen giden &ccedil;ok olunca bir&ccedil;ok ev de butik otel ve pansiyon olarak hizmet vermeye başladı.</p>\r\n\r\n<p>&Ccedil;arşıda en g&ouml;ze &ccedil;arpan yapı Kalkan Camii. M&uuml;badeleden &ouml;nce Rum Ortodoks Kilisesi olan zarif yapı g&uuml;n&uuml;m&uuml;zde her yerden g&ouml;r&uuml;lebiliyor. 1897&rsquo;de yapılmış olan oymalı kilisenin &ccedil;anı ise şimdi Kalkan K&ouml;y Odasında. Cumhuriyet caddesinden 5 dakika y&uuml;r&uuml;y&uuml;ş mesafesinde g&ouml;z alıcı mavilikte Akdeniz ve Kalkan plajı uzanıyor.</p>\r\n\r\n<p><strong>Kalkan Plajı</strong>, &ccedil;arşının hemen &ouml;n kısmında. Denizin rengini g&ouml;r&uuml;nce b&uuml;y&uuml;leneceksiniz zaten, kristal berraklığında, tertemiz. Y&uuml;zerken Caretta Caretta kaplumbağaları ile karşılaşabilirsiniz. Pırıl pırıl, mavi bayraklı bir halk plajı. Bir halk plajından beklenmeyecek kadar g&uuml;zel ve temiz. Her şeyiyle deniz sevenleri mutlu edecek &ouml;zelliklere sahip.</p>\r\n\r\n<p>Dağdan gelen kaynak suyunun denize karıştığı noktada su olduk&ccedil;a serin, yazın bunaltan sıcaklığında &ccedil;ok keyifli oluyor. Denizin turkuaz rengini de bu kaynak sularından alıyor. Sağ tarafta, yat limanına doğru olan alan biraz daha ılık. Sahili &ccedil;akılla kaplı. Kıyı boyunca iri, yuvarlak &ccedil;akılı taşları dolayısıyla deniz ayakkabınızın olması iyi olur. Denizi &ccedil;ok &ccedil;abuk derinleşiyor, k&uuml;&ccedil;&uuml;k &ccedil;ocuğu olanların dikkatli olmasında fayda var.</p>\r\n\r\n<p>Hafta sonları biraz kalabalık ama genelde şezlong ve şemsiye rahat bulunuyor, 2 şezlong ve 1 şemsiye &uuml;creti 30 TL. Duş ve şemsiye var. Kalkan gibi nispeten pahalı bir yere g&ouml;re, plajın yanı başındaki belediyeye ait tesiste fiyatlar makul. Eğer isterseniz kendi sandalyenizi yiyecek ve i&ccedil;eceğinizi de getirebilirsiniz.</p>\r\n\r\n<h3><strong>İslamlar K&ouml;y&uuml;</strong></h3>\r\n\r\n<p>Kaş &ccedil;evresinde bir kır gezisi planlıyorsanız g&ouml;rmeniz gereken bir k&ouml;y<strong>&nbsp;İslamlar</strong>. Beyaz &uuml;z&uuml;mleri ve alabalığı ile &uuml;nl&uuml; bir dağ k&ouml;y&uuml; olan İslamlar Kalkan&rsquo;a 9 km uzaklıkta. K&ouml;yde, T&uuml;rkler ve Rumların uzun yıllar birlikte yaşamışlar. K&ouml;y&uuml;n Rumca eski ismi ise Bodamya ve &lsquo;nehirler&rsquo; anlamına geliyor. K&ouml;y, g&uuml;r&uuml;l g&uuml;r&uuml;l akan dereleriyle yazın bunaltıcı sıcağında nefes aldıran bir vaha gibi.</p>\r\n\r\n<p>İslamlar K&ouml;y&uuml;&rsquo;ne geldiğinizde en eskisi 300 yıllık olmak &uuml;zere Rumlardan kalma pek &ccedil;ok su değirmenini g&ouml;receksiniz. G&ouml;ldağ mevkiindeki muazzam işlemeli kaya mezarları ve dağ yama&ccedil;larına oyulmuş pek &ccedil;ok kaya mezarı da ilgi &ccedil;ekici. Son yıllarda pop&uuml;ler olan villa tatili meraklısıysanız, bozulmamış doğası, sakin atmosferi ve olağan&uuml;st&uuml; Akdeniz manzarasıyla İslamlar K&ouml;y&uuml; de aklınızda olsun.</p>\r\n\r\n<p>Yemyeşil bir ormanda, dere kenarına kurulmuş alabalık &ccedil;iftlikleri ve pek &ccedil;ok restoranıyla sabah kahvaltısı veya yemek molası vermek i&ccedil;in ideal bir alternatif. Hem kahvaltı hem deniz &uuml;r&uuml;nleri bulabilirsiniz. Kaş-Fethiye arası yolculuk yaparken İslamlar k&ouml;y&uuml;nde bir mola verebilirsiniz. İslamlar K&ouml;y&uuml;&rsquo;n&uuml; g&ouml;rd&uuml;kten sonra belki de sırf mola yeri olarak değil, konaklama bile yapmak isteyebilirsiniz.</p>\r\n\r\n<h3><strong>Patara Antik Kenti</strong></h3>\r\n\r\n<p><strong>Patara Antik Kenti</strong>, Kaş&rsquo;a yakın &ccedil;ok &ouml;zel bir antik kent. Fethiye-Kalkan arasında Xanthos vadisinin g&uuml;neybatı ucunda bug&uuml;nk&uuml; Ovagelemiş k&ouml;y&uuml;nde yer alıyor. Kalkan&rsquo;dan Patara&rsquo;ya gidiş yaklaşık 20 dakika s&uuml;r&uuml;yor. T&uuml;rkiye&rsquo;nin en uzun plajı ve &lsquo;Tarihteki en iyi demokrasi &ouml;rneği&rsquo; olarak g&ouml;sterilen Likya Birliğinin &uuml;nl&uuml; meclisi burada. D&uuml;nyada&nbsp;<a href=\"https://yoldaolmak.com/noel-baba-kimdir.html\">Noel Baba</a>&nbsp;olarak bilinen Aziz Nikolaos&rsquo;ın doğduğu yer olarak da biliniyor. Patara Antik Kenti UNESCO Listesine girmeyi hak ediyor.</p>\r\n\r\n<p>Ayakta kalan en eski demokratik meclis binası, Helenistik form ile Roma mimarisi arasında ge&ccedil;işi temsil eden Patara amfitiyatrosu, Roma İmparatoru Neron&rsquo;un prestij eseri olarak yaptırılan, d&uuml;nyanın en eski deniz feneri kalıntıları, bazilika, kiliseler, Patara takı ve hamamlar ayakta kalan yapılar. Patara Plajı ise antik kentin denizle buluştuğu yerde kilometrelerce uzanıyor.</p>\r\n\r\n<p><strong>Patara Plajı</strong>, caretta carettaların milyonlarca yıldır yumurtalarını bıraktığı ender sahillerden. Plajın hemen arkasında kum tepeleri var ve &ccedil;&ouml;l havasında. Yeşil&ccedil;am filmlerindeki &ccedil;&ouml;l sahnelerinde burada &ccedil;ekilmiş. &Ouml;nce Xsanthos, Letoon ve Patara antik kentleri gezisi yapıp sonra da Patara Plajında g&uuml;n&uuml;n keyfini s&uuml;rd&uuml;rebileceğiniz, sevdiğim bir yer. Akşam 18.00 sonrası ziyaret yasağı var.</p>\r\n\r\n<p>Patara Antik Kenti yaz d&ouml;nemi (1 Nisan &ndash; 1 Ekim) 08.00-19.00, Kış d&ouml;nemi (1 Ekim &ndash; 1 Nisan) 08.30-17.30 arası ziyaret edilebilir. &Ouml;ren yeri haftanın 7 g&uuml;n&uuml; ziyarete a&ccedil;ık. Bilet satışı kapanıştan yarım saat &ouml;nce sona eriyor. Patara Antik Kenti giriş &uuml;creti 30TL. M&uuml;ze Kart ge&ccedil;erli.</p>\r\n\r\n<p><strong>Xanthos Antik Kenti</strong>, Likya Birliğine başkentlik yapmış b&uuml;y&uuml;leyici bir antik kent. Kalkan&rsquo;dan antik kente gitmek sadece yarım saat s&uuml;r&uuml;yor. Tarihte Likya Birliğinin idari merkezi olan antik kent T&uuml;rkiye&rsquo;nin UNESCO Listesine giren en eski tarihi değerlerinden.</p>\r\n\r\n<p>Xantos ge&ccedil;mişte gemilerin yanaşabileceği bir kıyı kentiymiş. Zaman i&ccedil;inde nehrin getirdiği al&uuml;vyonların denizi doldurmasıyla bug&uuml;n kıyıdan 8 km i&ccedil;eride kalmış. &Ouml;zg&uuml;rl&uuml;k uğruna savaşan t&uuml;m halkının tarih sahnesinden silindiği acıklı bir hik&acirc;yesi de var.</p>\r\n\r\n<p>M&Ouml; 545&rsquo;te Anadolu&rsquo;yu silip s&uuml;p&uuml;ren g&uuml;&ccedil;l&uuml; Pers ordusunun saldırısına karşı Xanthoslular efsanevi bir savunma g&ouml;sterse de direnişin fayda getirmeyeceğini anlamışlar. Bir tane bile Xanthoslunun teslim olmaması i&ccedil;in kadınlarını, &ccedil;ocuklarını, k&ouml;lelerini ve t&uuml;m mal varlıklarını toplayarak kalenin i&ccedil;inde ateşe vermişler ve &ouml;l&uuml;nceye kadar savaşmışlar.</p>\r\n\r\n<p>M&Ouml; 7. y&uuml;zyıla uzanan tarihi ge&ccedil;mişi sahip Xanthos&rsquo;ta, lahitler, mezarlar ve bir de antik tiyatro bulunuyor. Antik d&ouml;nemin en demokrat birliğinin başkentindeki t&uuml;m r&ouml;lyefler ve b&uuml;y&uuml;k mimari par&ccedil;alar bug&uuml;n Londra&rsquo;daki&nbsp;<a href=\"https://yoldaolmak.com/british-museum-londra.html\">British Museum</a>&rsquo;da sergileniyor.</p>\r\n\r\n<h3>Xsanthos Antik Kenti yaz d&ouml;nemi (1 Nisan &ndash; 1 Ekim) 08.00-19.00, Kış d&ouml;nemi (1 Ekim &ndash; 1 Nisan) 08.30-17.30 arası ziyaret edilebilir. &Ouml;ren yeri haftanın 7 g&uuml;n&uuml; ziyarete a&ccedil;ık. Ksanthos Antik Kenti giriş &uuml;creti 14TL. M&uuml;ze Kart ge&ccedil;erli.</h3>\r\n\r\n<h3><strong>Letoon Antik Kenti</strong></h3>\r\n\r\n<p><strong>Letoon Antik Kenti</strong>&nbsp;ise Kalkan&rsquo;ın bir diğer m&uuml;cevheri. UNESCO listesinde yer alan antik kent M&Ouml; 8. y&uuml;zyıla ait. Likya Birliğinin dini merkezi olan yerleşim Fethiye&rsquo;ye bağlı Kumluova k&ouml;y&uuml;n&uuml;n yakınlarında yer alıyor. Likya&rsquo;nın bu kutsal alanı Kalkan&rsquo;a yarım saat uzaklıkta. Xanthos ile arası ise sadece 10 dakika. Yunan mitolojisinde Zeus&rsquo;un &ccedil;ocukları olan Artemis ve Apollo&rsquo;nun annesi Leto&rsquo;dan adını alıyor.</p>\r\n\r\n<p>Antik kent merkezinde, yan yana dizilmiş &uuml;&ccedil; tapınak bulunuyor. Bunlardan en batıda İon d&uuml;zenindeki tapınak kentin tanrı&ccedil;ası olan Leto&rsquo;ya, daha k&uuml;&ccedil;&uuml;k olan ve ortada yer alan tapınak Artemis&rsquo;e, en doğudaki Dor d&uuml;zenli ise Apollon&rsquo;a ait. &Ouml;ren yeri i&ccedil;erisindeki stoalı &ccedil;eşme yapısı ve Helenistik devir tiyatrosu da kentin tarihi zenginliklerinden.</p>\r\n\r\n<p>Letoon Antik Kenti yaz d&ouml;nemi (1 Nisan &ndash; 1 Ekim) 08.00-19.00, Kış d&ouml;nemi (1 Ekim &ndash; 1 Nisan) 08.30-17.30 arası ziyaret edilebilir. &Ouml;ren yeri haftanın 7 g&uuml;n&uuml; ziyarete a&ccedil;ık. Bilet satışı kapanıştan yarım saat &ouml;nce sona eriyor. Letoon Antik Kenti giriş &uuml;creti 12TL. M&uuml;ze Kart ge&ccedil;erli.</p>\r\n\r\n<h3><strong>8. Bezirg&acirc;n K&ouml;y&uuml;</strong></h3>\r\n\r\n<p><strong>Bezirg&acirc;n K&ouml;y&uuml;</strong>, İngiliz The Times Gazetesi tarafından T&uuml;rkiye&rsquo;de gidilmesi gereken gizli kalmış 6 yerden biri olarak g&ouml;sterilmiş. K&ouml;y, T&uuml;rkmen ve Y&ouml;r&uuml;k k&uuml;lt&uuml;r&uuml;n&uuml;n izlerini taşıyor. Deniz seviyesinden 700 metre y&uuml;kseklikteki Bezirg&acirc;n yaylasında yer alan k&ouml;y 300 yıllık tarihi ge&ccedil;mişe sahip. Kalkan&rsquo;da yaşayan bir&ccedil;ok ailenin burada yayla evi var.</p>\r\n\r\n<p>K&ouml;y&uuml;n yerel mimariye sahip taş evleri &ccedil;ok g&uuml;zel. K&ouml;yde yaşayanların &uuml;rettiği &uuml;r&uuml;nlerin satıldığı şirin bir pazar yeri var. Doğal &uuml;r&uuml;nler arayanlar bu pazarı &ccedil;ok seviyor. Bezirg&acirc;n k&ouml;y&uuml; ve Bezirg&acirc;n yaylası, Kalkan&rsquo;a ise 12 km mesafede yer alıyor.</p>\r\n\r\n<p>Doğa y&uuml;r&uuml;y&uuml;ş&uuml; yapabileceğiniz yaylada konaklama se&ccedil;eneği fazla değil. K&ouml;yde 2 bin yıldan fazla bir s&uuml;re &ouml;nce Likyalılar tarafından kullanılan ahşap tahıl ambarlarını halen ayakta. Ambarların işlevi ve tasarımının o zamandan bu yana &ccedil;ok az değiştiği s&ouml;yleniyor.</p>\r\n\r\n<h2><strong>Kalkan&rsquo;a nasıl gidilir</strong></h2>\r\n\r\n<p>Kalkan, Akdeniz B&ouml;lgesi&rsquo;nin Antalya B&ouml;l&uuml;m&uuml;&rsquo;nde, Antalya&rsquo;nın batısında yer alıyor. Antalya&rsquo;nın Kaş il&ccedil;esine bağlı bir mahalle olan Kalkan, Kaş&rsquo;ın batısında, i&ccedil;erisine Kaputaş Plajı&rsquo;nı da alan b&ouml;lgede konumlanıyor.</p>\r\n\r\n<p><strong>Kalkan&rsquo;a hava yoluyla ulaşım</strong>: Kalkan&rsquo;a en yakın havalimanı Muğla&rsquo;nın Dalaman il&ccedil;esinde bulunuyor. Dalaman Havalimanı, Kalkan&rsquo;a 123 km uzaklıkta. Dalaman Havalimanı&rsquo;na T&uuml;rkiye ve d&uuml;nyanın farklı kentlerinden direkt u&ccedil;uşlarla ulaşım sağlanıyor.</p>\r\n\r\n<p><strong>Dalaman Havalimanından Kalkan&rsquo;a ulaşım</strong>: Dalaman Havalimanı&rsquo;ndan Kalkan&rsquo;a herhangi bir toplu ulaşım aracı yok. Havalimanından ara&ccedil; kiralayarak, taksi ya da &ouml;zel transfer hizmetiyle Kalkan&rsquo;a &ccedil;ok hızlı bir şekilde ulaşabilirsiniz. Dalaman-Kaş Shuttle servisi ile Kalkan&rsquo;a ulaşım 80 TL tutuyor.</p>\r\n\r\n<p>Dalaman Havalimanı&rsquo;ndan Fethiye&rsquo;ye seferleri bulunan HAVAŞ servisleri ya da MUTTAŞ ara&ccedil;larıyla Fethiye Otogar&rsquo;a gittikten sonra, Fethiye Otogar&rsquo;dan her saat başı hareket eden Kaş dolmuşlarıyla Kalkan&rsquo;a ulaşabilirsiniz.</p>', '126e6025-6abf-4e4a-851a-d0a372f2f0cc', '4bc4bd36-ac62-4d30-956a-6cc0c38bf642', NULL),
('57ac2f69-6f53-4a01-b8f1-133752dbeda0', 'Narsist Partnerle İlişki', 'narsist-partnerle-iliski', 'Partneriniz aşırı derecede kendini beğenmiş; sizin duygularınıza ve düşüncelerinize önem vermeyen, sürekli övgü ve hayranlık bekleyen; kendini sizden, diğer insanlardan üstün ve daima haklı gören biriyse narsisistik biri olma ihtimali yüksektir. Narsisistik bir partnerle ilişki yürütmek yorucu ve zorlayıcı olabilir. Size kendinizi birçok açıdan yetersiz hissettirebilirler. Bu nedenle ilişkinizde sağlıklı sınırlar oluşturmanız çok önemlidir. Sağlıklı sınırları olan bir ilişkide sizin de ihtiyaçlarınız vardır, duygu ve düşünceleriniz önemli ve değerlidir. İhtiyaçlarınıza, duygu ve düşüncelerinize sahip çıkmalısınız. Narsisistik partner ihtiyaçlarınızı önemsemeyip görmezden gelerek, duygu ve düşüncelerinize kulak asmayarak sınırlarınızı ihlal etmeye çalışabilir. Ancak bunun sizin sınırınıza haksız bir müdahale olduğunu fark etmeniz ve müsaade etmemeniz önemlidir. Hiç kimse sizin ihtiyaçlarınızı sizden daha iyi bilemez, bu mümkün değildir. Partneriniz hatta hiç kimse size ne düşünmeniz ya da ne hissetmeniz gerektiğini söyleme hakkına sahip değildir. Düşünceleriniz ve hisleriniz size aittir, siz isterseniz değişirler. Sınırlarınızın ihlal edildiği anları fark edin ve sağlıklı sınırlar oluşturma üzerine gerçekçi bir plan yapın. Partneriniz narsisistik bir birey olsun ya da olmasın sağlıklı sınırlar her ilişki için gereklidir. Ancak özellikle de narsisistik bir partnerleyken olmazsa olmazdır.\r\n\r\nSiz sağlıklı sınırlar belirlediğinizde ve bunları uygulamaya başladığınızda partneriniz şaşırabilir, bu yeni sınırlara öfkelenebilir ve sınırlarınızı zorlamaya başlayabilir. Partneriniz özel muamele görmesi gerektiğine inandığı ve sizden de bunu beklediği için sınırlarınızı tanımayabilir. Sınırlarınıza saldırmayı kendine hak görebilir. Bu noktada sınırlarınızın ve kararlarınızın arkasında durmanız çok önemlidir. Kimsenin siz izin vermediğiniz müddetçe sizin koyduğunuz sınırları aşmak gibi bir hakkı yoktur. Sınırlar sizin bahçenizin çitleridir, alanınızın nerede başlayıp nerede bittiğini belirtirler. Bahçenizi dış dünyadan gelebilecek tehlikelerden korurlar, oranın sahipsiz olmadığını gösterirler. Bu nedenle sınır koymak önemlidir. Sınırlarınızın arkasında kararlılıkla durun çünkü gevşettiğiniz anda tekrar sınır koymak çok daha zor olabilir.\r\n\r\nNarsisistik bir partnerle beraber olan bazı kişiler partnerlerini “değiştirme”, “düzeltme” gibi gerçek dışı amaçlar edinebilirler. Bu amaçları gerçekleşmedikçe de hayal kırıklığına kapılıp hayıflanabilirler. Unutmayın ki siz kimsenin kurtarıcısı değilsiniz. Ayrıca kişi kendi davranışlarını fark edip bunlardan rahatsız olmadığı ya da bunları değiştirmek istemediği sürece değişemez. Partnerinizin sizi ya da diğer insanları rahatsız eden davranışları konusunda farkındalık kazanmasını sağlayacak adımlar atabilirsiniz ya da onu bir uzmanla görüşmesi için destekleyebilirsiniz. Ancak en nihayetinde bunu yapacak olan kendisidir. Kendinizi bir kurtarıcı rolüne sokmak ya da üzerinize fazlaca sorumluluk almak yalnızca sizi yıpratır.\r\n\r\nNarsisistik bir partner sizi duygusal açıdan zorlayabilir. Partneriniz karşısında yargılanmış ve tükenmiş hissedebilirsiniz. Bu ilişki fiziksel ve psikolojik sağlığınıza zarar verebilir. Bu noktada siz de bir uzmana danışabilirsiniz. Sosyal destek sisteminizi (aile, arkadaş vb.) devreye sokabilir; yaşadıklarınızı, duygu ve düşüncelerinizi onlarla paylaşabilirsiniz. Size iyi gelen aktivitelere daha çok zaman ayırabilirsiniz. Narsisistik bir partnerle beraberken sizin de zorlanmanız normaldir. Destek istemekten çekinmeyin, yalnız olmak zorunda değilsiniz.\r\n\r\n', 'fd485cd8-73c5-4666-abab-272dde4727f4', '4bc4bd36-ac62-4d30-956a-6cc0c38bf642', '2021-12-04 11:42:02');
INSERT INTO `blog_languages` (`id`, `title`, `slug`, `description`, `language_id`, `blog_id`, `deleted_at`) VALUES
('586877be-a52d-4059-9b45-7bdf7ce695e9', 'Evlilikte Kişisel Sınırların Önemi', 'evlilikte-kisisel-sinirlarin-onemi', '<p>Evlilikte Kişisel Sınırları Belirlemek Sınırlar her ilişkiye ve eşlerin ihtiya&ccedil;larına g&ouml;re farklılık g&ouml;sterebilir. Bununla beraber aşağıdaki bazı alanlar sık tartışılanlar arasındadır ve başka alanlar i&ccedil;in de temel oluşturabilirler: &Ccedil;iftler her konuda birbirleriyle bilgi paylaşmak istemeyebilirler ve gizliliği &ouml;nemsiyor olabilirler. Bu durumda gizlilikten ne anladıklarını konuşmaları ve bunu uygulayacakları yerler (cep telefonu, sosyal medya, şifre paylaşımı, eski ilişkiler, ge&ccedil;mişle ilgili ayrıntılar vs.) konusunda anlaşmaları faydalı olabilir. &Ccedil;alışma zamanı ve yalnızlık zamanını belirleyebilmek ve birbirine bunun i&ccedil;in uygun ortamı sağlamak da &ouml;nemli alanlar arasındadır. Hem kendi taleplerimizi dayatmadan karşı tarafın &ouml;zg&uuml;r bırakılması hem de birlikte vakit ge&ccedil;irmek i&ccedil;in ortak zaman ve mekan yaratılması dengeli bir şekilde g&ouml;zetilebilir. Ev işlerinin planlanması, ebeveyn olarak sahip olunan beklentiler, evde birlikte yapılan aktiviteler gibi detaylar konuşularak ev ve aile hayatına y&ouml;nelik sınırlar belirlenebilir. Partnerler olarak ilişkilerine y&ouml;nelik sadakat, g&uuml;ven ve saygı gibi konularda beklentilerini ifade edebilirler. Bununla beraber akrabalarla ve arkadaşlarla ilişkiler bağlamında da sınırlar tartışılabilir. Ekonomik veya duygusal her t&uuml;rl&uuml; karar alma s&uuml;recinde &ccedil;iftlerin birbirine nereye kadar m&uuml;dahil olacakları belirlenebilir. Evlilikteki Kişisel Sınırlar Nasıl Korunur? &Ccedil;iftlerin isteklerini a&ccedil;ık bir dille ifade etmesi ve tartışması &ouml;nemlidir. B&ouml;ylelikle iki taraf da konuştukları konular hakkında aynı şeyi anlayıp anlamadıklarını sağlıklı bir şekilde değerlendirebilirler. Sınırlar belirlenirken de korunurken de partnerlerin değişebilen ihtiya&ccedil;ları eşit bir şekilde dikkate alınmalıdır. Dolayısıyla evlilik boyunca bu konuda iletişime a&ccedil;ık olunması ve gerektiğinde sınırların yenilenmesi faydalı olabilir. Herhangi bir sınır ihlali ger&ccedil;ekleştiğinde nasıl bir &ccedil;&ouml;z&uuml;m &uuml;retileceği konuşulabilir. Diyelim y&uuml;ksek sesle tartışılmamasına y&ouml;nelik bir kural belirlenmesine rağmen partnerlerden biri bağırdı. Buna &ccedil;&ouml;z&uuml;m olarak da tartışmanın durdurulması ve bağıran kişinin bir s&uuml;reliğine y&uuml;r&uuml;y&uuml;ş yapması belirlenebilir. Ayrıca eşlerden biri sınırları istemeden de olsa ihlal etse, hemen kendisini durdurması gerektiği vurgulanabilir. Sınırları belirlemede ve korumada zaman zaman aksaklıklar meydana gelebileceği kabul edilebilir. Problemi &ccedil;&ouml;zmek i&ccedil;in sorumluluk almak saygılı bir iletişim i&ccedil;in &ccedil;ok faydalı olabilir. Sınırları belirlemekte ve korumakta aşamayacağınızı d&uuml;ş&uuml;nd&uuml;ğ&uuml;n&uuml;z sorunlar yaşanıyorsa bir uzmana başvurulabilir.</p>', 'fd485cd8-73c5-4666-abab-272dde4727f4', 'ee133e8b-3590-4434-a891-4529896f8734', NULL),
('686ea3b5-8845-443b-9117-47b853a745ba', 'Evlilikte Kişisel Sınırların Önemi', 'evlilikte-kisisel-sinirlarin-onemi', '<p>Evlilikte Kişisel Sınırları Belirlemek Sınırlar her ilişkiye ve eşlerin ihtiya&ccedil;larına g&ouml;re farklılık g&ouml;sterebilir. Bununla beraber aşağıdaki bazı alanlar sık tartışılanlar arasındadır ve başka alanlar i&ccedil;in de temel oluşturabilirler: &Ccedil;iftler her konuda birbirleriyle bilgi paylaşmak istemeyebilirler ve gizliliği &ouml;nemsiyor olabilirler. Bu durumda gizlilikten ne anladıklarını konuşmaları ve bunu uygulayacakları yerler (cep telefonu, sosyal medya, şifre paylaşımı, eski ilişkiler, ge&ccedil;mişle ilgili ayrıntılar vs.) konusunda anlaşmaları faydalı olabilir. &Ccedil;alışma zamanı ve yalnızlık zamanını belirleyebilmek ve birbirine bunun i&ccedil;in uygun ortamı sağlamak da &ouml;nemli alanlar arasındadır. Hem kendi taleplerimizi dayatmadan karşı tarafın &ouml;zg&uuml;r bırakılması hem de birlikte vakit ge&ccedil;irmek i&ccedil;in ortak zaman ve mekan yaratılması dengeli bir şekilde g&ouml;zetilebilir. Ev işlerinin planlanması, ebeveyn olarak sahip olunan beklentiler, evde birlikte yapılan aktiviteler gibi detaylar konuşularak ev ve aile hayatına y&ouml;nelik sınırlar belirlenebilir. Partnerler olarak ilişkilerine y&ouml;nelik sadakat, g&uuml;ven ve saygı gibi konularda beklentilerini ifade edebilirler. Bununla beraber akrabalarla ve arkadaşlarla ilişkiler bağlamında da sınırlar tartışılabilir. Ekonomik veya duygusal her t&uuml;rl&uuml; karar alma s&uuml;recinde &ccedil;iftlerin birbirine nereye kadar m&uuml;dahil olacakları belirlenebilir. Evlilikteki Kişisel Sınırlar Nasıl Korunur? &Ccedil;iftlerin isteklerini a&ccedil;ık bir dille ifade etmesi ve tartışması &ouml;nemlidir. B&ouml;ylelikle iki taraf da konuştukları konular hakkında aynı şeyi anlayıp anlamadıklarını sağlıklı bir şekilde değerlendirebilirler. Sınırlar belirlenirken de korunurken de partnerlerin değişebilen ihtiya&ccedil;ları eşit bir şekilde dikkate alınmalıdır. Dolayısıyla evlilik boyunca bu konuda iletişime a&ccedil;ık olunması ve gerektiğinde sınırların yenilenmesi faydalı olabilir. Herhangi bir sınır ihlali ger&ccedil;ekleştiğinde nasıl bir &ccedil;&ouml;z&uuml;m &uuml;retileceği konuşulabilir. Diyelim y&uuml;ksek sesle tartışılmamasına y&ouml;nelik bir kural belirlenmesine rağmen partnerlerden biri bağırdı. Buna &ccedil;&ouml;z&uuml;m olarak da tartışmanın durdurulması ve bağıran kişinin bir s&uuml;reliğine y&uuml;r&uuml;y&uuml;ş yapması belirlenebilir. Ayrıca eşlerden biri sınırları istemeden de olsa ihlal etse, hemen kendisini durdurması gerektiği vurgulanabilir. Sınırları belirlemede ve korumada zaman zaman aksaklıklar meydana gelebileceği kabul edilebilir. Problemi &ccedil;&ouml;zmek i&ccedil;in sorumluluk almak saygılı bir iletişim i&ccedil;in &ccedil;ok faydalı olabilir. Sınırları belirlemekte ve korumakta aşamayacağınızı d&uuml;ş&uuml;nd&uuml;ğ&uuml;n&uuml;z sorunlar yaşanıyorsa bir uzmana başvurulabilir.</p>', 'fd485cd8-73c5-4666-abab-272dde4727f4', 'ee133e8b-3590-4434-a891-4529896f8734', '2021-12-04 11:47:02'),
('7ab79972-ae0b-4607-9137-cec86f70a14f', 'Evlilikte Kişisel Sınırların Önemi', 'evlilikte-kisisel-sinirlarin-onemi', 'Evlilikte Kişisel Sınırları Belirlemek\r\nSınırlar her ilişkiye ve eşlerin ihtiyaçlarına göre farklılık gösterebilir. Bununla beraber aşağıdaki bazı alanlar sık tartışılanlar arasındadır ve başka alanlar için de temel oluşturabilirler:\r\n\r\nÇiftler her konuda birbirleriyle bilgi paylaşmak istemeyebilirler ve gizliliği önemsiyor olabilirler. Bu durumda gizlilikten ne anladıklarını konuşmaları ve bunu uygulayacakları yerler (cep telefonu, sosyal medya, şifre paylaşımı, eski ilişkiler, geçmişle ilgili ayrıntılar vs.) konusunda anlaşmaları faydalı olabilir.\r\nÇalışma zamanı ve yalnızlık zamanını belirleyebilmek ve birbirine bunun için uygun ortamı sağlamak da önemli alanlar arasındadır. Hem kendi taleplerimizi dayatmadan karşı tarafın özgür bırakılması hem de birlikte vakit geçirmek için ortak zaman ve mekan yaratılması dengeli bir şekilde gözetilebilir.\r\nEv işlerinin planlanması, ebeveyn olarak sahip olunan beklentiler, evde birlikte yapılan aktiviteler gibi detaylar konuşularak ev ve aile hayatına yönelik sınırlar belirlenebilir.\r\nPartnerler olarak ilişkilerine yönelik sadakat, güven ve saygı gibi konularda beklentilerini ifade edebilirler. Bununla beraber akrabalarla ve arkadaşlarla ilişkiler bağlamında da sınırlar tartışılabilir.\r\nEkonomik veya duygusal her türlü karar alma sürecinde çiftlerin birbirine nereye kadar müdahil olacakları belirlenebilir.\r\nEvlilikteki Kişisel Sınırlar Nasıl Korunur?\r\nÇiftlerin isteklerini açık bir dille ifade etmesi ve tartışması önemlidir. Böylelikle iki taraf da konuştukları konular hakkında aynı şeyi anlayıp anlamadıklarını sağlıklı bir şekilde değerlendirebilirler.\r\nSınırlar belirlenirken de korunurken de partnerlerin değişebilen ihtiyaçları eşit bir şekilde dikkate alınmalıdır. Dolayısıyla evlilik boyunca bu konuda iletişime açık olunması ve gerektiğinde sınırların yenilenmesi faydalı olabilir. \r\nHerhangi bir sınır ihlali gerçekleştiğinde nasıl bir çözüm üretileceği konuşulabilir. Diyelim yüksek sesle tartışılmamasına yönelik bir kural belirlenmesine rağmen partnerlerden biri bağırdı. Buna çözüm olarak da tartışmanın durdurulması ve bağıran kişinin bir süreliğine yürüyüş yapması belirlenebilir. Ayrıca eşlerden biri sınırları istemeden de olsa ihlal etse, hemen kendisini durdurması gerektiği vurgulanabilir.\r\nSınırları belirlemede ve korumada zaman zaman aksaklıklar meydana gelebileceği kabul edilebilir. Problemi çözmek için sorumluluk almak saygılı bir iletişim için çok faydalı olabilir.\r\nSınırları belirlemekte ve korumakta aşamayacağınızı düşündüğünüz sorunlar yaşanıyorsa bir uzmana başvurulabilir.', 'fd485cd8-73c5-4666-abab-272dde4727f4', 'ee133e8b-3590-4434-a891-4529896f8734', '2021-12-04 11:46:42'),
('9204aec3-68bc-44d9-8fab-7c0c86846fd3', 'Narsist Partnerle İlişki', 'narsist-partnerle-iliski', '<p>Partneriniz aşırı derecede kendini beğenmiş; sizin duygularınıza ve d&uuml;ş&uuml;ncelerinize &ouml;nem vermeyen, s&uuml;rekli &ouml;vg&uuml; ve hayranlık bekleyen; kendini sizden, diğer insanlardan &uuml;st&uuml;n ve daima haklı g&ouml;ren biriyse narsisistik biri olma ihtimali y&uuml;ksektir. Narsisistik bir partnerle ilişki y&uuml;r&uuml;tmek yorucu ve zorlayıcı olabilir. Size kendinizi bir&ccedil;ok a&ccedil;ıdan yetersiz hissettirebilirler. Bu nedenle ilişkinizde sağlıklı sınırlar oluşturmanız &ccedil;ok &ouml;nemlidir. Sağlıklı sınırları olan bir ilişkide sizin de ihtiya&ccedil;larınız vardır, duygu ve d&uuml;ş&uuml;nceleriniz &ouml;nemli ve değerlidir. İhtiya&ccedil;larınıza, duygu ve d&uuml;ş&uuml;ncelerinize sahip &ccedil;ıkmalısınız. Narsisistik partner ihtiya&ccedil;larınızı &ouml;nemsemeyip g&ouml;rmezden gelerek, duygu ve d&uuml;ş&uuml;ncelerinize kulak asmayarak sınırlarınızı ihlal etmeye &ccedil;alışabilir. Ancak bunun sizin sınırınıza haksız bir m&uuml;dahale olduğunu fark etmeniz ve m&uuml;saade etmemeniz &ouml;nemlidir. Hi&ccedil; kimse sizin ihtiya&ccedil;larınızı sizden daha iyi bilemez, bu m&uuml;mk&uuml;n değildir. Partneriniz hatta hi&ccedil; kimse size ne d&uuml;ş&uuml;nmeniz ya da ne hissetmeniz gerektiğini s&ouml;yleme hakkına sahip değildir. D&uuml;ş&uuml;nceleriniz ve hisleriniz size aittir, siz isterseniz değişirler. Sınırlarınızın ihlal edildiği anları fark edin ve sağlıklı sınırlar oluşturma &uuml;zerine ger&ccedil;ek&ccedil;i bir plan yapın. Partneriniz narsisistik bir birey olsun ya da olmasın sağlıklı sınırlar her ilişki i&ccedil;in gereklidir. Ancak &ouml;zellikle de narsisistik bir partnerleyken olmazsa olmazdır. Siz sağlıklı sınırlar belirlediğinizde ve bunları uygulamaya başladığınızda partneriniz şaşırabilir, bu yeni sınırlara &ouml;fkelenebilir ve sınırlarınızı zorlamaya başlayabilir. Partneriniz &ouml;zel muamele g&ouml;rmesi gerektiğine inandığı ve sizden de bunu beklediği i&ccedil;in sınırlarınızı tanımayabilir. Sınırlarınıza saldırmayı kendine hak g&ouml;rebilir. Bu noktada sınırlarınızın ve kararlarınızın arkasında durmanız &ccedil;ok &ouml;nemlidir. Kimsenin siz izin vermediğiniz m&uuml;ddet&ccedil;e sizin koyduğunuz sınırları aşmak gibi bir hakkı yoktur. Sınırlar sizin bah&ccedil;enizin &ccedil;itleridir, alanınızın nerede başlayıp nerede bittiğini belirtirler. Bah&ccedil;enizi dış d&uuml;nyadan gelebilecek tehlikelerden korurlar, oranın sahipsiz olmadığını g&ouml;sterirler. Bu nedenle sınır koymak &ouml;nemlidir. Sınırlarınızın arkasında kararlılıkla durun &ccedil;&uuml;nk&uuml; gevşettiğiniz anda tekrar sınır koymak &ccedil;ok daha zor olabilir. Narsisistik bir partnerle beraber olan bazı kişiler partnerlerini &ldquo;değiştirme&rdquo;, &ldquo;d&uuml;zeltme&rdquo; gibi ger&ccedil;ek dışı ama&ccedil;lar edinebilirler. Bu ama&ccedil;ları ger&ccedil;ekleşmedik&ccedil;e de hayal kırıklığına kapılıp hayıflanabilirler. Unutmayın ki siz kimsenin kurtarıcısı değilsiniz. Ayrıca kişi kendi davranışlarını fark edip bunlardan rahatsız olmadığı ya da bunları değiştirmek istemediği s&uuml;rece değişemez. Partnerinizin sizi ya da diğer insanları rahatsız eden davranışları konusunda farkındalık kazanmasını sağlayacak adımlar atabilirsiniz ya da onu bir uzmanla g&ouml;r&uuml;şmesi i&ccedil;in destekleyebilirsiniz. Ancak en nihayetinde bunu yapacak olan kendisidir. Kendinizi bir kurtarıcı rol&uuml;ne sokmak ya da &uuml;zerinize fazlaca sorumluluk almak yalnızca sizi yıpratır. Narsisistik bir partner sizi duygusal a&ccedil;ıdan zorlayabilir. Partneriniz karşısında yargılanmış ve t&uuml;kenmiş hissedebilirsiniz. Bu ilişki fiziksel ve psikolojik sağlığınıza zarar verebilir. Bu noktada siz de bir uzmana danışabilirsiniz. Sosyal destek sisteminizi (aile, arkadaş vb.) devreye sokabilir; yaşadıklarınızı, duygu ve d&uuml;ş&uuml;ncelerinizi onlarla paylaşabilirsiniz. Size iyi gelen aktivitelere daha &ccedil;ok zaman ayırabilirsiniz. Narsisistik bir partnerle beraberken sizin de zorlanmanız normaldir. Destek istemekten &ccedil;ekinmeyin, yalnız olmak zorunda değilsiniz.</p>', 'fd485cd8-73c5-4666-abab-272dde4727f4', '4bc4bd36-ac62-4d30-956a-6cc0c38bf642', '2021-12-04 12:00:44'),
('a5ae8989-8ed9-4002-941e-39224f672e16', 'Narsist Partnerle İlişki', 'narsist-partnerle-iliski', '<p>Partneriniz aşırı derecede kendini beğenmiş; sizin duygularınıza ve d&uuml;ş&uuml;ncelerinize &ouml;nem vermeyen, s&uuml;rekli &ouml;vg&uuml; ve hayranlık bekleyen; kendini sizden, diğer insanlardan &uuml;st&uuml;n ve daima haklı g&ouml;ren biriyse narsisistik biri olma ihtimali y&uuml;ksektir. Narsisistik bir partnerle ilişki y&uuml;r&uuml;tmek yorucu ve zorlayıcı olabilir. Size kendinizi bir&ccedil;ok a&ccedil;ıdan yetersiz hissettirebilirler. Bu nedenle ilişkinizde sağlıklı sınırlar oluşturmanız &ccedil;ok &ouml;nemlidir. Sağlıklı sınırları olan bir ilişkide sizin de ihtiya&ccedil;larınız vardır, duygu ve d&uuml;ş&uuml;nceleriniz &ouml;nemli ve değerlidir. İhtiya&ccedil;larınıza, duygu ve d&uuml;ş&uuml;ncelerinize sahip &ccedil;ıkmalısınız. Narsisistik partner ihtiya&ccedil;larınızı &ouml;nemsemeyip g&ouml;rmezden gelerek, duygu ve d&uuml;ş&uuml;ncelerinize kulak asmayarak sınırlarınızı ihlal etmeye &ccedil;alışabilir. Ancak bunun sizin sınırınıza haksız bir m&uuml;dahale olduğunu fark etmeniz ve m&uuml;saade etmemeniz &ouml;nemlidir. Hi&ccedil; kimse sizin ihtiya&ccedil;larınızı sizden daha iyi bilemez, bu m&uuml;mk&uuml;n değildir. Partneriniz hatta hi&ccedil; kimse size ne d&uuml;ş&uuml;nmeniz ya da ne hissetmeniz gerektiğini s&ouml;yleme hakkına sahip değildir. D&uuml;ş&uuml;nceleriniz ve hisleriniz size aittir, siz isterseniz değişirler. Sınırlarınızın ihlal edildiği anları fark edin ve sağlıklı sınırlar oluşturma &uuml;zerine ger&ccedil;ek&ccedil;i bir plan yapın. Partneriniz narsisistik bir birey olsun ya da olmasın sağlıklı sınırlar her ilişki i&ccedil;in gereklidir. Ancak &ouml;zellikle de narsisistik bir partnerleyken olmazsa olmazdır. Siz sağlıklı sınırlar belirlediğinizde ve bunları uygulamaya başladığınızda partneriniz şaşırabilir, bu yeni sınırlara &ouml;fkelenebilir ve sınırlarınızı zorlamaya başlayabilir. Partneriniz &ouml;zel muamele g&ouml;rmesi 