('132350d7-4c2f-4f87-bb7b-ac43e3317bb9', 'Hakkımızda Deneme(en)', 'Hakkımızda Deneme(en)', '<p><strong>SahilVillam&nbsp;</strong>kuruluşumuz 2016 yılından itibaren, konuklarımızın eşsiz ve unutulmaz bir tatil deneyimi yaşamaları i&ccedil;in &ccedil;alışıyor. <strong>SahilVillam</strong>&nbsp;olarak portf&ouml;y&uuml;m&uuml;zde yer alan b&uuml;t&uuml;n kiralık villaları ve apartları yerinde inceliyoruz. 1000&rsquo;in &uuml;zerinde yerinde g&ouml;rd&uuml;ğ&uuml;m&uuml;z kiralık villa se&ccedil;eneğimiz ile bir&ccedil;ok b&ouml;lgede on binlerce m&uuml;şterimize g&uuml;venle villa kiralama konforu yaşatmayı sağlarkenTatilinizde hi&ccedil;bir aksaklıkla karşılaşmamanız i&ccedil;in portf&ouml;y&uuml;m&uuml;z&uuml; titiz incelemeler sonucu oluşturuyor ve tatiliniz s&uuml;resince yaşayabileceğiniz b&uuml;t&uuml;n sorunlarınızda SahilVillam Ailesi olarak yanınızda olmayı misyonumuz olarak kabul ediyoruz. Konuklarımızı m&uuml;şteri olarak değil evimize gelen misafir kabulediyoruz. Konuklarımızın villa kabullerini kesinlikle kendimiz ve veya villa sahibi ile beraber yapıyoruz. &Ccedil;&uuml;nk&uuml; siz değerli misafirlerimizin tatillerini g&uuml;venle ge&ccedil;irebilmelerini sağlamak, yanlarında olduğumuzu hissettirmek kuruluşumuzun en &ouml;nemli &ouml;nceliğidir.</p>', '4fa4cf50-c249-4ad3-8abf-d12b7cfd9242', '126e6025-6abf-4e4a-851a-d0a372f2f0cc', 'Kiralık Villalar,Kiralık Tatil,Kalkan Kiralık Villalar,Kaş kiralık Villalar,Antalya Kiralık Villalar,Antalya Muhafazakar Villaları,Kalkan Muhafazakar villaları', 'Etiketler (en)', NULL, '2021-12-29 08:17:13', '2021-12-29 08:17:13'),
('3bc23bb8-491e-4bbe-a386-cc874d3fdf3a', 'Hakkımızda Deneme(en)', 'Hakkımızda Deneme(en)', '<p><strong>SahilVillam&nbsp;</strong>kuruluşumuz 2016 yılından itibaren, konuklarımızın eşsiz ve unutulmaz bir tatil deneyimi yaşamaları i&ccedil;in &ccedil;alışıyor. <strong>SahilVillam</strong>&nbsp;olarak portf&ouml;y&uuml;m&uuml;zde yer alan b&uuml;t&uuml;n kiralık villaları ve apartları yerinde inceliyoruz. 1000&rsquo;in &uuml;zerinde yerinde g&ouml;rd&uuml;ğ&uuml;m&uuml;z kiralık villa se&ccedil;eneğimiz ile bir&ccedil;ok b&ouml;lgede on binlerce m&uuml;şterimize g&uuml;venle villa kiralama konforu yaşatmayı sağlarkenTatilinizde hi&ccedil;bir aksaklıkla karşılaşmamanız i&ccedil;in portf&ouml;y&uuml;m&uuml;z&uuml; titiz incelemeler sonucu oluşturuyor ve tatiliniz s&uuml;resince yaşayabileceğiniz b&uuml;t&uuml;n sorunlarınızda SahilVillam Ailesi olarak yanınızda olmayı misyonumuz olarak kabul ediyoruz. Konuklarımızı m&uuml;şteri olarak değil evimize gelen misafir kabulediyoruz. Konuklarımızın villa kabullerini kesinlikle kendimiz ve veya villa sahibi ile beraber yapıyoruz. &Ccedil;&uuml;nk&uuml; siz değerli misafirlerimizin tatillerini g&uuml;venle ge&ccedil;irebilmelerini sağlamak, yanlarında olduğumuzu hissettirmek kuruluşumuzun en &ouml;nemli &ouml;nceliğidir.</p>', '4fa4cf50-c249-4ad3-8abf-d12b7cfd9242', '126e6025-6abf-4e4a-851a-d0a372f2f0cc', 'Meta Açıklama (en)', 'Etiketler (en)', '2021-12-29 08:17:13', '2021-12-29 08:15:23', '2021-12-29 08:17:13'),
